import React, {
  Fragment
} 
from 'react';

import Input from "./components/input";
import Grid from "./components/grid";
import Button from "./components/button";
import ButtonGroup from "./components/buttonGroup";
import Jumbotron from "./components/jumbotron";
import Display from "./components/display";

function App() {
  return (
    <Fragment>
      <Jumbotron>
        <Grid>
          <Grid size="2" gapY="0px">
            <Input label="Break length" placeholder="in minutes" type="number"/>
            <Input label="Session length" placeholder="in minutes" type="number"/>
          </Grid>

          <hr className="my-4"/>

          <ButtonGroup>
            <Button name="Start" success/>
            <Button name="Stop" danger/>
            <Button name="Reset"/>
          </ButtonGroup>
        </Grid>
      </Jumbotron>
      <Display>
        00:00
      </Display>
    </Fragment>
  );
}

export default App;
